<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.2/css/bootstrap.min.css">

    <title>Room Detail</title>
    <style>
        body {
            padding-top: 70px;

        }

        .navbar {
            background-color: #F7F4E9;
        }

        .card-text {
            margin-right: 80px;
        }

        .container {
            display: flex;
            flex-direction: column;
            align-items: flex-start;
        }

        .desc {
            min-width: 700px;
        }

        .price-card-container {
            position: sticky;
            top: 80px;
            align-self: flex-end;
            margin-top: 20px;
            transition: all 0.3s ease;
            min-width: 400px;
        }

        .price-card-container.fixed {
            position: fixed;
        }

        .custom {
            width: 170px;
            height: 60px;
            padding: 10px;
            border-radius: 5px;
            border: 1px solid #ccc;
            outline: none;
            transition: border-color 0.3s;
            margin: 5px;
        }

        .btn2 {
            background-color: #FF735B;
            border: none;
            border-radius: 5px;
            color: #fff;
            width: 100%;
        }

        .btn1 {
            border: 1px solid #FF735B;
            border-radius: 5px;
            background-color: #fff;
            color: #FF735B;
            width: 100%;
            
            
        }

        

        img {
            border-radius: 5px;
        }

        .custom-select {
            position: relative;
            display: inline-block;
            width: 200px;

        }

        .custom-select-toggle {
            display: flex;
            align-items: center;


            cursor: pointer;
            font-size: 16px;



        }

        .custom-select-options {
            position: absolute;
            top: 100%;
            left: 0;
            z-index: 1;
            width: 100%;
            max-height: 200px;
            overflow-y: auto;
            background-color: #fff;
            border: 1px solid #ccc;
            border-top: none;
            border-bottom-left-radius: 5px;
            border-bottom-right-radius: 5px;
            display: none;
        }

        .custom-select-option {
            display: block;
            padding: 10px;
            cursor: pointer;
        }

        .custom-select-option:hover {
            background-color: #f8f9fa;
        }

        input {
            border: 1px solid #ccc;
            color: #555;
            border-radius: 5px;

        }

        .gallery-container {
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
        }

        .gallery-item {
            margin: 10px;
            width: 200px;
            height: 200px;
        }

    </style>
</head>

